	# looping 1000 kali 
	
	WHILE i < n DO 
		-- statement # increment
		
		# id_jalur
      SET id_jalur_masuk = (SELECT FLOOR(RAND() * (3-1+1) + 1) LIMIT 1 );
      
  		SET id_pendaftar = (select CONCAT('P', YEAR(CURRENT_DATE()), id_jalur_masuk, (i+1)));
  		
