  		SET id_bank = (SELECT FLOOR(RAND() * (4-1+1) + 1) LIMIT 1 );
  		SET is_bayar = 1;
  	
      IF id_jalur_masuk = 1 THEN
         SET nominal_bayar = null;
         SET id_bank = NULL;
         SET is_bayar = 1;
      END IF;
      
      IF (i+1) % 7 = 0 then
      	SET jenis_kelamin = 'P';
      	SET tempat_lahir = 'Bandung';
      END if;
      
      if (i+1) % 6 = 0 then
      	SET is_bayar = 0;
      END if;
         
      # insert data dummy ke tabel pendaftar    
      VALUES( id_pendaftar, id_jalur_masuk, nama, nisn, nik, tempat_lahir, tgl_lahir, jenis_kelamin, no_hp, id_prodi1, id_prodi2, nominal_bayar, id_bank, is_bayar);
		SET pendaftar_id = (SELECT LAST_INSERT_ID());
		
